import { useState, useEffect } from "react";
import axios from "axios";
import {
  Button,
  Card,
  CardContent,
  Grid,
  Stack,
  Typography,
} from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import { Link } from "react-router-dom";
import Nav from "../Nav/Nav";

const Expense = () => {
  const [expenses, setExpenses] = useState([{}]);

  const getAllExpenses = async () => {
    console.log("I was ran");
    const expenses = await axios.get("http://localhost:3001/expenses");
    setExpenses(expenses.data);
    console.log(expenses);
    console.log(expenses.data);

    // return expenses;
  };

  useEffect(() => {
    getAllExpenses();
    console.log("This is useEffect");
    console.log(expenses);
  }, []);

  return (
    <>
      <Nav />
      <Box
        sx={{
          display: "flex",
          justifyContent: "center",
          marginTop: "2rem",
          alignItems: "center",
          //   border: "2px solid blue",
        }}
      >
        <Typography variant="h2" color="secondary">
          Welcome to Expenses Screen
        </Typography>
      </Box>
      <Box
        sx={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Button
          variant="outlined"
          onClick={() => getAllExpenses()}
          sx={{ marginLeft: "2rem" }}
        >
          Get Expenses
        </Button>
        <Button
          href="/expenses/new"
          variant="contained"
          sx={{ marginLeft: "2rem" }}
        >
          New Expense
        </Button>
      </Box>
      <Card color="secondary" sx={{ width: 275 }}>
        <CardContent>
          <Typography variant="h2">My Card</Typography>
          <Typography variant="h6">Some Text Random Lol FU</Typography>
        </CardContent>
      </Card>
      <Card sx={{ width: 475, margin: "2rem" }}>
        {expenses.map((expense) => (
          <Stack spacing={6}>
            <CardContent>
              {/* <div> */}
              <Stack
                display="flex"
                spacing={6}
                flexDirection="row"
                justifyContent="center"
                alignItems="center"
              >
                <Typography color="primary" variant="h4">
                  {expense.item}
                </Typography>
                <Typography color="secondary" variant="h6">
                  {expense.amount}
                </Typography>
                <Typography color="primary.light" variant="h6">
                  {expense.date}
                </Typography>
                <Typography color="secondary.light" variant="h6">
                  {expense.category}
                </Typography>
              </Stack>
              {/* {expense.item} {expense.amount} */}
              {/* </div> */}
            </CardContent>
          </Stack>
        ))}
      </Card>
    </>
  );
};

export default Expense;
